export const DASHBOARD_SET_USERNAME = 'DASHBOARD_SET_USERNAME';
export const STORE_ACTIVE_USERS = 'STORE_ACTIVE_USERS '

export const setDashboardUsername = (username) => ({
    type: DASHBOARD_SET_USERNAME,
    username
});
